import React, { useState } from 'react';

// Icon components


interface SnapshotCardProps {
  icon: React.ReactNode;
  title: string;
  summary: string;
  actionText: string;
  actionVariant?: 'primary' | 'secondary';
  onClick?: () => void;
}

interface HomeDashboardProps {
  onNavigateToSymptomInsights?: (symptomName: string, severity: number, date: string) => void;
  onNavigateToAlerts?: () => void;
  onNavigateToLog?: () => void;
}

const SnapshotCard: React.FC<SnapshotCardProps> = ({
  icon,
  title,
  summary,
  actionText,
  actionVariant = 'secondary',
  onClick
}) => (
  <div className="bg-white rounded-xl border border-gray-200 p-4 mb-4">
    <div className="flex items-start justify-between">
      <div className="flex items-center space-x-3">
        <div className="flex-shrink-0">
          {icon}
        </div>
        <div className="flex-1 min-w-0">
          <h3 className="text-sm font-semibold text-gray-900">{title}</h3>
          <p className="text-sm text-gray-600 mt-1">{summary}</p>
        </div>
      </div>
      <button
        onClick={onClick}
        className={`text-sm font-medium px-3 py-1 rounded-lg transition-colors ${
          actionVariant === 'primary' 
            ? 'bg-indigo-600 text-white hover:bg-indigo-700' 
            : 'text-indigo-600 hover:text-indigo-700'
        }`}
      >
        {actionText}
      </button>
    </div>
  </div>
);

const HomeDashboard: React.FC<HomeDashboardProps> = ({ 
  onNavigateToSymptomInsights, 
  onNavigateToAlerts, 
  onNavigateToLog 
}) => {
  const [currentTime] = useState(() => {
    const hour = new Date().getHours();
    if (hour < 12) return 'morning';
    if (hour < 17) return 'afternoon';
    return 'evening';
  });

  const greeting = `Good ${currentTime}, Jamie's Mom!`;

  const handleVisitSummaryClick = () => {
    // Placeholder: In a real app, this would navigate to a summary screen
    alert('Summary will auto-compile from your symptom logs.');
  };

  return (
    <div className="px-4 py-6">

        {/* Personalized Greeting */}
        <div className="mb-6">
          <h2 className="text-2xl font-bold text-gray-900">{greeting}</h2>
        </div>

        {/* Today at a glance */}
        <div className="bg-white rounded-xl border border-gray-200 p-6 mb-6 shadow-sm">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Today at a glance</h3>
          <div className="space-y-4">
            {/* Row 1: Log Symptom primary CTA */}
            <button
              onClick={onNavigateToLog}
              className="w-full bg-indigo-600 text-white font-semibold py-3 px-4 rounded-lg hover:bg-indigo-700 transition-colors text-center"
            >
              Log Symptom
            </button>

            {/* Row 2: Visit summary secondary CTA */}
            <button
              onClick={handleVisitSummaryClick}
              className="w-full border border-indigo-200 text-indigo-600 font-medium py-3 px-4 rounded-lg hover:bg-indigo-50 transition-colors text-center"
            >
              Visit summary (draft)
            </button>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="bg-white rounded-xl border border-gray-200 p-6 mb-6 shadow-sm">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>

          {/* Mobile: Large single-line buttons */}
          <div className="block md:hidden space-y-3">
            <button
              onClick={onNavigateToLog}
              className="w-full bg-indigo-600 text-white font-semibold py-4 px-4 rounded-lg hover:bg-indigo-700 transition-colors text-center flex items-center justify-center space-x-2"
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6v6m0 0v6m0-6h6m-6 0H6" />
              </svg>
              <span>Log Symptom</span>
            </button>

            <button
              onClick={() => alert('Camera functionality coming soon! Media will be saved to your next symptom log.')}
              className="w-full bg-green-600 text-white font-semibold py-4 px-4 rounded-lg hover:bg-green-700 transition-colors text-center flex items-center justify-center space-x-2"
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
              </svg>
              <span>Add Media (photo/video)</span>
            </button>

            <button
              onClick={() => {
                const note = prompt('Add a note to your care team (logistics only, not for symptoms):');
                if (note) {
                  alert('Note saved! This will appear in Care Team > Shared artifacts.');
                }
              }}
              className="w-full bg-blue-600 text-white font-semibold py-4 px-4 rounded-lg hover:bg-blue-700 transition-colors text-center flex items-center justify-center space-x-2"
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
              </svg>
              <span>Add Note to Provider</span>
            </button>
          </div>

          {/* Desktop/Tablet: Compact pills */}
          <div className="hidden md:flex space-x-3">
            <button
              onClick={onNavigateToLog}
              className="bg-indigo-600 text-white font-medium py-2 px-4 rounded-full hover:bg-indigo-700 transition-colors flex items-center space-x-2"
            >
              <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6v6m0 0v6m0-6h6m-6 0H6" />
              </svg>
              <span>Log Symptom</span>
            </button>

            <button
              onClick={() => alert('Camera functionality coming soon! Media will be saved to your next symptom log.')}
              className="bg-green-600 text-white font-medium py-2 px-4 rounded-full hover:bg-green-700 transition-colors flex items-center space-x-2"
            >
              <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
              </svg>
              <span>Add Media</span>
            </button>

            <button
              onClick={() => {
                const note = prompt('Add a note to your care team (logistics only, not for symptoms):');
                if (note) {
                  alert('Note saved! This will appear in Care Team > Shared artifacts.');
                }
              }}
              className="bg-blue-600 text-white font-medium py-2 px-4 rounded-full hover:bg-blue-700 transition-colors flex items-center space-x-2"
            >
              <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z" />
              </svg>
              <span>Add Note</span>
            </button>
          </div>
        </div>

        {/* Jamie's Care Snapshot */}
        <div className="bg-gradient-to-r from-indigo-50 to-purple-50 border border-indigo-200 rounded-xl p-4 shadow-sm mb-8" role="region" aria-label="Personalized care insights">
          <div className="flex items-start space-x-3">
            <div className="flex-shrink-0 w-8 h-8 bg-indigo-100 rounded-full flex items-center justify-center" aria-hidden="true">
              <svg className="w-4 h-4 text-indigo-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
              </svg>
            </div>
            <div className="flex-1 min-w-0">
              <h3 className="text-sm font-semibold text-indigo-900 mb-2">Jamie's Care Snapshot</h3>
              <div className="space-y-2 text-sm text-indigo-800">
                <p>• Jamie has logged <span className="font-semibold text-indigo-900">headaches</span> 4 times in the last 2 months</p>
                <p>• <span className="font-semibold text-indigo-900">Iron intake</span> is below target this week</p>
                <p>• <span className="font-semibold text-indigo-900">Medication compliance</span> is at 85% this week</p>
              </div>
            </div>
          </div>
        </div>

        {/* PMS-Specific Tip Carousel */}
        <div className="mt-8">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Today's Tips</h3>
          <div className="bg-gradient-to-r from-green-50 to-blue-50 rounded-xl p-4 border border-green-200">
            <div className="flex items-start space-x-3">
              <div className="flex-shrink-0 w-8 h-8 bg-green-100 rounded-full flex items-center justify-center">
                <span className="text-green-600 text-sm font-bold">✓</span>
              </div>
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-900 mb-1">Do: Include leafy greens today</p>
                <p className="text-xs text-gray-600">Spinach and kale are rich in essential nutrients for PMS management</p>
                <button 
                  onClick={() => onNavigateToSymptomInsights?.('Fatigue', 3, 'Today')}
                  className="text-xs text-indigo-600 hover:text-indigo-700 font-medium mt-2"
                >
                  Why this recommendation? →
                </button>
              </div>
            </div>
          </div>

          <div className="bg-gradient-to-r from-red-50 to-orange-50 rounded-xl p-4 border border-red-200 mt-3">
            <div className="flex items-start space-x-3">
              <div className="flex-shrink-0 w-8 h-8 bg-red-100 rounded-full flex items-center justify-center">
                <span className="text-red-600 text-sm font-bold">✗</span>
              </div>
              <div className="flex-1">
                <p className="text-sm font-medium text-gray-900 mb-1">Don't: Skip hydration</p>
                <p className="text-xs text-gray-600">Aim for 8 glasses of water to support overall health</p>
              </div>
            </div>
          </div>
        </div>
    </div>
  );
};

export default HomeDashboard;
